import React from 'react';

const Navigation = ({ openModal, fetchData }) => {
    const openInstructionsModal = (modalName) => {
        openModal(modalName);
    };

    return (
        <div className="navbar">
            <div className="container">
                {/* Scan button directly in the navigation */}
                <div onClick={() => { fetchData(); }} className="box box-scan">Scan</div>
                {/* Other buttons that open instruction modals */}
                <div onClick={() => openInstructionsModal('coe')} className="box">COE</div>
                <div onClick={() => openInstructionsModal('enrollment')} className="box">Enrollment MG</div>
                <div onClick={() => openInstructionsModal('schedule')} className="box">Schedule</div>
                <div onClick={() => openInstructionsModal('dd214')} className="box">DD214</div>
                <div onClick={() => openInstructionsModal('tar')} className="box">TAR</div>
                <div onClick={() => openInstructionsModal('awardLetter')} className="box">Award Letter</div>
            </div>
        </div>
    );
};

export default Navigation;
